import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AboutUs from "./components/About";
import Hero from "./components/Hero";
import Navbar from "./components/Navbar";
import Events from "./components/Events";
import { Memories } from "./components/Memories";
import { Leaders } from "./components/Leaders";
import { Team } from "./components/Team";
import { CommentSection } from "./components/CommentSection";
import { Sponsors } from "./components/Sponsors";
import { Footer } from "./components/Footer";
import Single_Event from "./components/Single_Event";

function App() {
  return (
    <Router>
      <div className="App overflow-x-hidden">
        {/* Navbar is shared across all pages */}
        <Navbar />

        <Routes>
          {/* Route for the landing page with all components */}
          <Route
            path="/"
            element={
              <>
                <Hero />
                <AboutUs />
                <Events />
                <Memories />
                <Leaders />
                <Team />
                <CommentSection />
                <Sponsors />
                <Footer />
              </>
            }
          />

          {/* Route for each individual section */}
          <Route path="/about" element={<AboutUs />} />
          <Route path="/events" element={<Events />} />
          <Route path="/memories" element={<Memories />} />
          <Route path="/leaders" element={<Leaders />} />
          <Route path="/team" element={<Team />} />
          <Route path="/comments" element={<CommentSection />} />
          <Route path="/sponsors" element={<Sponsors />} />

          {/* Route for the single event page */}
          <Route path="/event/:id" element={<Single_Event />} />
        </Routes>

        {/* Footer is shared across all pages */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
